	(425, 76, 'contenido_post', '<h2>El 17H empezó a producir el 9 de marzo y el 18H está en etapa de perforación con una inversión cercana a los US$ 14 millones.</h2>\r\nPetroTal anunció la puesta en operación de su nuevo pozo horizontal 17H, con una profundidad vertical de 2,700 metros y una sección lateral de más de 1,200 metros, en el campo Bretaña Norte del Lote 95 (Loreto), actualmente el principal productor de petróleo crudo del país. El pozo 17H, que empezó a producir el 9 de marzo y demandó una inversión de US$ 14 millones aproximadamente, alcanzó una producción promedio de 3,619 barriles de petróleo por día (bopd, por sus siglas en inglés), en condición fluyente (flujo natural), durante los primeros siete días de producción, y todavía se espera un mayor rendimiento una vez que se arranque la bomba electro sumergible (ESP) ya instalada en el pozo. El operador del Lote 95, que inició sus operaciones en el año 2018, también se encuentra perforando el pozo 18H, con una inversión cercana a los US$ 14 millones, y que deberá empezar a producir a mediados de mayo. Guillermo Flórez, gerente general de PetroTal, destacó que la empresa sigue invirtiendo a paso firme para alcanzar el objetivo trazado para este 2024, que es obtener una producción promedio de 17 000 bopd.'),
	(426, 76, '_contenido_post', 'field_662eee5183e2f'),
